import React, { FC } from 'react';
import { Wrapper, Card } from './styles';

import logo from '../../assets/logo.svg';

const Home: FC = () => {
    return (
        <>
            <Wrapper>
                <img src={ logo } alt="MemeMaker"/>

                <Card>
                    <h2>Selecione um template</h2>
                </Card>
            </Wrapper>
        </>
    );
};

export default Home;
